import { memo } from 'react'

const Buttons = ({ result, setResult }) => {
  return (
    <div>
      <button onClick={() => setResult(result - 1)}>-</button>
      <button onClick={() => setResult(0)}>reset</button>
      <button onClick={() => setResult(result + 1)}>+</button>
    </div>
  )
}

export default memo(Buttons)
